mutation UpdateSeekerProfResumePosition($input: ProfResumePositionInput!) {
  updateSeekerProfResumePosition(input: $input) {
    errors {
      ... on ProfResumeDoesNotExist {
        message
        __typename
      }
      ... on ProfResumeDoesNotBelongToSeeker {
        message
        __typename
      }
      ... on ProfResumeDuplicated {
        message
        __typename
      }
      __typename
    }
    __typename
  }
}
